import React from "react";
import Header from "./common/header"
import Tablelist from "./common/table"
import ConfirmedCase from './common/confirmedcase'
import RecoveredCase from './common/recoveredcase'
import DeathsCase from './common/deathscase'

export default function Manage(props) {
    console.log(props.location.pathname.split('/')[1])
  return (
    <React.Fragment>
        <Header />

        {
            props.location.pathname.split('/')[1] === "confirmed-cases"?
                <ConfirmedCase {...props}/>
            :
             props.location.pathname.split('/')[1] === "recovered-cases"?
                <RecoveredCase {...props}/>
             :
             props.location.pathname.split('/')[1] === "death-cases"?
                <DeathsCase {...props}/>
             :
                <Tablelist {...props}/>
        }
    </React.Fragment>
  );
}
